import React from "react";
import "./App.css";   // <-- import CSS

function App() {
  const user = {
    username: "JohnDoe",
    points: 1250
  };

  const tableData = [
    { rank: 1, name: "Alice", points: 3000, organization: "Org A" },
    { rank: 2, name: "Bob", points: 2700, organization: "Org B" },
    { rank: 3, name: "Charlie", points: 2500, organization: "Org C" }
  ];

  return (
    <div className="page-container">

      {/* Top-left user bar */}
      <div className="user-bar">
        <span className="user-text">User: {user.username}</span>
        <span className="user-text">Points: {user.points}</span>
      </div>

      {/* Main table */}
      <div className="table-container">
        <table className="custom-table">
          <thead>
            <tr>
              <th>Rank</th>
              <th>Name</th>
              <th>Points</th>
              <th>Organization</th>
            </tr>
          </thead>

          <tbody>
            {tableData.map((row, index) => (
              <tr key={index}>
                <td>{row.rank}</td>
                <td>{row.name}</td>
                <td>{row.points}</td>
                <td>{row.organization}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

    </div>
  );
}

export default App;
